import './MenuElement.css';

const MenuElement = ((props) => {
  return (
      <li key={props.data.key}>
        <img src={props.data.icon} alt={props.data.icon} />
        <span>{props.data.title}</span>
      </li>
    )
})

export default MenuElement;
